import React from "react";
import cl from "./PaymentForm.module.css"

export const PaymentForm=({...props})=>{ 

    return( 
        <div className={cl.main}>
            <img className={cl.img} src={props.p.img}/>
            <p className={cl.description}>{props.p.description}</p>
            <h3>{props.p.price}</h3>
            

        </div>
    )
}
